import React from 'react'
import styled from 'styled-components'



const CartSection = styled.div``;
const CartWrapper  = styled.div``;
const CartContainer  = styled.div``;
const CartImage  = styled.img``;
const CartContent  = styled.div``;



const Cart = (carts) => {
    return (
        <CartSection>
         <CartWrapper>
         {carts.map((cart, index) => {
                    return (
                        <CartContainer key={index}>


                                    <CartImage src={cart.image} alt={cart.alt} />
                                    <CartContent>
                                        <h1>{cart.title}</h1>
                                        <p>{cart.price}</p>
                                        <Button to={cart.path} primary='true'>{cart.label}</Button>
                                    </CartContent>



                        </CartContainer>
                    )
                })}
         </CartWrapper>
        </CartSection>

    )
}

export default Cart
